import React, { Component } from "react";
import "./assets/css/style.cs"
class App extends Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div>
                <img class="img-container" src="assets/img/logotipo-do-github.png" alt=""/>
                <input class="input-container" type="text" placeholder="Digite o nickname do github"></input>
            </div>
        )
    }
}

export default App;
